            "sentence":"In 1983 an average of one new computer magazine appeared each week . By late that year more than 200 existed . Their numbers and size grew rapidly with the industry they covered , and `` BYTE '' and `` 80 Micro `` were among the three thickest magazines of any kind per issue `` . Compute `` s editor in chief reported in the December 1983 issue that `` all of our previous records are being broken : largest number of pages , largest-number of four-color advertising pages , largest number of printing pages , and the largest number of editorial pages '' . Computers were the only industry with product-specific magazines , like `` 80 Micro '' , `` PC Magazine `` , and `` Macworld `` ; their editors vowed to impartially cover their computers whether or not doing so hurt their readers ' and advertisers ' market , while claiming that their rivals pandered to advertisers by only publishing positive news .",
