            "guid_idx":"13_32",
            "sentence":"An Intergovernmental Conference ( IGC ) is the formal procedure for negotiating amendments to the founding treaties of the European Union . Under the treaties , an IGC is called into being by the European Council , and is composed of representatives of the member states , with the Commission , and to a lesser degree the Parliament also participating . An IGC will conclude with a meeting of the European Council , at which any political issues requiring resolution at the level of Heads of State or Government will be resolved , and final political agreement will be reached . A final treaty text in each of the community languages will then be prepared by the legal and linguistic experts of the member states , before being presented to the member states for signature and ratification . There was much criticism of the functioning of this process in the negotiation of the Treaty of Nice in 2001 , especially in regard to the Nice European Council which concluded the IGC .",
