            "alias_idx":0,
            "guid_idx":"15_0",
            "sentence":"The next IGC , due to meet in October 2003 , was prepared for by the Convention on the Future of Europe , which was modelled after the Convention which negotiated the Charter of Fundamental Rights . One of the recommendations of the Convention is that a convention be used to prepare for future IGCs ; this has now indeed been incorporated into the treaty as a requirement for future treaty revisions , unless the European Parliament decides that it is not necessary ( eg . for minor amendments ) . The European Council of 21\u201322 June 2007 delivered to the Portuguese Presidency the mandate to call an IGC . Its objective was to draw up a Treaty amending the existing Treaties with a view to enhancing the efficiency and democratic legitimacy of the enlarged Union , as well as the coherence of its external action .",
